import React from 'react'
import Navbar from './Navbar'
import titleGoldBg from "../assets/LOH_LONG_CURVED_COLOR_2.png";

function Connect() {
  return (
    <div className='base'>
       <Navbar />
       <div>
        <img className="title-gold-bg" src={titleGoldBg}/>
      </div>

    </div>
  )
}

export default Connect
